import './Subject.css';
import Media from 'react-media';

// Export Component
export default function ReturnSuBJect() {

 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ReturnSuBJectSmall />}
     {matches.medium && <ReturnSuBJectLarge />}
     {matches.large && <ReturnSuBJectLarge />}
    </>
   )}
  </Media>
 );

};


export function ReturnSuBJectLarge() {
 return (
  <div className='wrp-subject-dash'>
   <SubJectElement Title={'date'} Text={'02 Dec 2022'} />
   <SubJectElement Title={'transaction type'} Text={'Monais'} />
   <SubJectElement Title={'Unite'} Text={'USD'} />
   <SubJectElement Title={'Quantite'} Text={'23'} />
  </div>
 );
};
export function ReturnSuBJectSmall() {
 return (
  <div className='wrp-subject-dash'>
   <SubJectElement Title={'date'} Text={'02 Dec 2022'} />
   <SubJectElement Title={'transaction type'} Text={'Monais'} />
   <SubJectElement Title={'Unite'} Text={'USD'} />
   <SubJectElement Title={'Quantite'} Text={'23'} />
  </div>
 );
};

const ScreenLarge = (props) => (
 <div className='wrp-sub-subject-dash'>
  <h2>{props.Title}</h2>
  <p>{props.Text}</p>
 </div>
);
const ScreenSmall = (props) => (
 <div className='wrp-sub-subject-dash-sm'>
  <h2>{props.Title}</h2>
  <p>{props.Text}</p>
 </div>
);
